import React, { Component } from "react";

export default class PersonFound extends Component {
  constructor(props) {
    super(props);
    this.handleClick = this.handleClick.bind(this);
  }
  handleClick() {
    console.log(this.props.location.state.first);
  }
  render() {
    return(
      <div>
      <h3>Person Found</h3>
      <button onClick={this.handleClick}>first</button>
      </div>
    );
  }
}
